import {
  Box,
  Button,
  FormControl,
  IconButton,
  InputAdornment,
  InputLabel,
  OutlinedInput,
  Stack,
  TextField,
  Typography,
} from "@mui/material";
import * as React from "react";
import Visibility from "@mui/icons-material/Visibility";
import VisibilityOff from "@mui/icons-material/VisibilityOff";
import { Link } from "react-router-dom";

function LoginBorneMulhouse1() {
  const [values, setValues] = React.useState({
    email: "",
    password: "",
    showPassword: false,
  });

  const handleChange = (prop) => (event) => {
    setValues({ ...values, [prop]: event.target.value });
  };

  const handleClickShowPassword = () => {
    setValues({
      ...values,
      showPassword: !values.showPassword,
    });
  };

  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };

  return (
    <Box>
      <Typography>
        Veuillez vous connecter pour pouvoir utiliser la borne
      </Typography>
      <Box sx={{ backgroundColor: "coral" }}>
        <Stack sx={{ spacing }}>
          <Typography>Login</Typography>
          <FormControl sx={{ m: 1, width: "25ch" }} variant="outlined">
            <InputLabel id="outlined-input" label="Email" type="email" required>
              Email
            </InputLabel>
            <OutlinedInput
              required
              id="outlined-adornment-email"
              label="email"
              value={values.email}
              onChange={handleChange("email")}
            />
          </FormControl>

          <FormControl
            sx={{
              m: 1,
              width: "25ch",
              display: "flex",
              flexWrap: "wrap",
            }}
            variant="outlined"
          >
            <InputLabel
              required
              id="outlined-password-input"
              label="Password"
              type="password"
              autoComplete="current-password"
            >
              Password
            </InputLabel>
            <OutlinedInput
              id="outlined-adornment-password"
              type={values.showPassword ? "text" : "password"}
              value={values.password}
              onChange={handleChange("password")}
              endAdornment={
                <InputAdornment position="end">
                  <IconButton
                    aria-label="toggle password visibility"
                    onClick={handleClickShowPassword}
                    onMouseDown={handleMouseDownPassword}
                    edge="end"
                  >
                    {values.showPassword ? <VisibilityOff /> : <Visibility />}
                  </IconButton>
                </InputAdornment>
              }
              label="Password"
            />
          </FormControl>
          <Button
            variant="contained"
            onClick={() => {
              <Link to="/" />;
            }}
          >
            Valider
          </Button>
        </Stack>
      </Box>
    </Box>
  );
}

export default LoginBorneMulhouse1;
